taxonomicNotes:
A number of subspecies have been identified (Anderson and Wallmo 1984):
<br><i>O. h. californicus</i> (Caton, 1876) ‚Äì California Mule Deer;
<br><i>O. h. cerrosensis</i> Merriam, 1898 ‚Äì Cedros Island Deer;
<br><i>O. h. columbianus</i> (Richardson, 1829) ‚Äì Columbian Black-tailed Deer;
<br><i>O. h. crooki</i> (Mearns, 1897) (<i>eremicus</i> Mearns and <i>canus</i> Merriam are synonyms), Heffelfinger (2000) considered <i>O. h. eremicus</i> as the correct name for Desert Mule Deer, because the specimen type of this subspecies is a hybrid of Mule Deer and White-tailed Deer;
<br><i>O. h. fuliginatus</i> Cowan, 1933 ‚Äì Southern Mule Deer;
<br><i>O. h. hemionus</i> (Rafinesque, 1817) ‚Äì Rocky Mountain Mule Deer;
<br><i>O. h. inyoensis</i> Cowan, 1933 (the validity is questionable) ‚Äì Inyo Mule Deer;
<br><i>O. h. peninsulae</i> (Lydekker, 1898) ‚Äì Peninsula Mule Deer;
<br><i>O. h. sheldoni</i> Goldman, 1939 ‚Äì Tiburon Island Mule Deer;
<br><i>O. h. sitkensis</i> Merriam, 1898 ‚Äì Sitka Black-tailed Deer.
